  selector: 'app-modal',
  templateUrl: './modal.component.html',
  styleUrls: ['./modal.component.scss']
})
export class ModalComponent {

  constructor(private modalSS: SwitchService) { }

  closeModal(){
    this.modalSS.$modal.emit(false);
  }

}
